import React from "react";


// this is the props you recieved from App.js, do you need to import it from above though?

function List (props) {
var x = props.groceries; 
var display = x.map(function(item) {
  <li>{item}</li>
});


  return (
    <ul className="list-group">
      Using the map method, render one li element displaying the text property of each grocery
      object.
      {display}

    </ul>

  );
}
   //   {props.groceries} // you cannot return the entire object like this.....you will have to return it to map thorugh it 
export default List;
